window.bookSummaryJSON = "<p><b>The tower's mysteries grow deeper....</b></p> <p>Closer to finding his sister than ever before, Max still has more questions than answers.</p> <p>Why has she left cryptic messages across the lower floors of the tower?</p> <p>What is she trying to tell him?</p> <p>And then there's the last question. The one that keeps him up at night. The kind of question that makes him wonder if he really wants to know the answer.&nbsp;</p> <p>What kind of climber has his little sister become?&nbsp;</p> <p>With a new elite mission assignment that promises insights into Max's search, he plans to give it everything he's got.&nbsp;</p> <p><b>Will Max be able to find his sister before it's too late?</b></p> <p><b><i>Tower Climber 3</i></b><b>&nbsp;is the third instalment in the best-selling LitRPG/Progression fantasy series from Jakob Tanner, author of&nbsp;</b><b><i>Arcane Kingdom Online</i></b><b>.&nbsp;The story contains RPG mechanics, stats, and ranks as a form of power progression.</b></p> <p><b>Pick it up today!</b></p>"; 
